import React, { useEffect, useState } from 'react';
import { useDispatch, useSelector } from "react-redux";

import { get_all_countries } from "../redux/action";

import CardCountry from './CardCountry';

import "../css/Countries.css";

function Countries() {

  const dispatch = useDispatch();
  const countries = useSelector((state) => state.countries);
  const [next, setNext] = useState(10);
  const [back, setBack] = useState(0);
  let contadorPage = countries.length / 10;
  let contadorBtn = contadorPage / 5;

  const onClickChangePage = () => {

  }

  const onclickPage = (e) => {
    console.log("boton que presione: ", e.target.id)
  }

  useEffect(() => {
    !countries.length && dispatch(get_all_countries());
  }, [countries, dispatch]);

  return (
    <React.Fragment>
      <div className="paginado">
        <button id='backpage' onClick={onClickChangePage}>{'<<'}</button>
        <div className='content_btn_page'>
          <button onClick={onClickChangePage}>{'<'}</button>
          {
            countries.length && countries.map((p, i) => {
              if (i < contadorBtn) {
                return (
                  <button key={p.id} id={i + 1} onClick={onclickPage}>{i + 1}</button>
                );
              }
            })
          }
          <button onClick={onClickChangePage}>{'>'}</button>
        </div>
        <button id='nextpage' >{'>>'}</button>
      </div>

      <div className='content_countries'>
        {
          countries.length && countries.map((c) => {
            return <CardCountry key={c.id} id={c.id} imagen={c.imagen} nombre={c.name} continente={c.continente} poblacion={c.poblacion} />
          })
        }
      </div>
    </React.Fragment>
  )
}

export default Countries;
